import { BrowserRouter, Routes,Route } from 'react-router-dom';
import './App.css';
import UserList from './UserList';

function App() {
  return (
    <div className="App">
      <h3>React JS CRUD application</h3>
    </div>
  );
  <BrowserRouter>
    <Routes>
      <Route path='/userslist' element={<UserList/>}/>
      <Route path='/*' element={<Navigate to='/userslist' />} />
    </Routes>
  </BrowserRouter>
}

export default App;
